  render() {
    return (
      <Container fluid>
        <Row>
          <Jumbotron>
            <h1>Clothing Detail</h1>
          </Jumbotron>
          <Col size="md-12">
            <Row>
              <div className="col align-self-center">Clothing</div>
            </Row>
            <Row>
              <Col size="md-3">Shirt/Pant/Outerwear/Shoe 1</Col>
              <Col size="md-3">Shirt/Pant/Outerwear/Shoe 2</Col>
              <Col size="md-3">Shirt/Pant/Outerwear/Shoe 3</Col>
              <Col size="md-3">Shirt/Pant/Outerwear/Shoe 4</Col>
            </Row>
            <Row>
              <div className="col align-self-center">Color Picker / Slider</div>
            </Row>
            <Row>
              <div className="col align-self-center">
                <button>GO FISH</button>
              </div>
            </Row>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default ClothingDetail;
